INSERT INTO `berita` (`beritaID`, `penggunaID`, `judul`, `isi`, `tanggal_dikirim`) VALUES
(29, 1, 'Istri dan Cucu Pasien Klaster Berkoh Dinyatakan Positif Corona, Total Kini Ada 35 Orang di Banyumas', '<p><img src=\"https://asset-2.tstatic.net/banyumas/foto/bank/images/bupati-banyumas-achmad-husein-saat-meninjau-gelanggang-olahraga-gor-satria-purwokerto.jpg\" alt=\"Istri dan Cucu Pasien Klaster Berkoh Dinyatakan Positif Corona, Total Kini Ada 35 Orang di Banyumas\"></p><p class=\"ql-align-justify\"><strong>TRIBUNBANYUMAS.COM, PURWOKERTO -</strong>&nbsp;Jumlah kasus&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/pasien-positif-corona\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">pasien&nbsp;positif&nbsp;corona</a>&nbsp;atau&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/covid-19\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Covid-19</a>&nbsp;di Kabupaten&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/banyumas\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Banyumas</a>, Sabtu (25/4/2020) petang menjadi 35 orang. Angka tersebut menurut&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/bupati-banyumas\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Bupati&nbsp;Banyumas</a>,&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/achmad-husein\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Achmad&nbsp;Husein</a>&nbsp;belum terbendung atau masih bertambah di wilayahnya. Achmad Husein mengumumkan hal tersebut melalui unggahan video di akun Instagram pribadinya, Sabtu (25/4/2020) petang.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Bila terdapat tujuh pasien tambahan yang terkonfirmasi positif. Sebanyak empat orang dari Klaster Gowa, kemudian dua orang dari&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/klaster-berkoh\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Klaster&nbsp;Berkoh</a>, Purwokerto Selatan. Lalu seseorang asal Kelurahan Teluk, Purwokerto Selatan, yang dirawat di RSUD DR R Goeteng Tarunadibrata&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/purbalingga\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Purbalingga</a>. \"Untuk positif tes swab ada tambahan empat (Klaster Gowa), yaitu dari Desa Tipar Kecamatan Ajibarang.\"</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"Desa Semedo Kecamatan Pekuncen, Desa Purbandana Kecamatan Kembaran, dan Desa Kedungwringin Kecamatan Patikraja,\" kata Husein. Keempatnya, kata Husein, dirawat di RSUD Ajibarang, Kabupaten&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/banyumas\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Banyumas</a>. Lebih lanjut Husein mengatakan,&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/klaster-berkoh\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Klaster&nbsp;Berkoh</a>&nbsp;bertambah dua orang yang terdiri dari istri dan cucunya. Penelusuran&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/klaster-berkoh\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Klaster&nbsp;Berkoh</a>&nbsp;berawal dari suami yang telah meninggal dunia dan belakangan terkonfirmasi positif&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/covid-19\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Covid-19</a>. \"Untuk pasien yang dirawat di&nbsp;<a href=\"https://banyumas.tribunnews.com/tag/purbalingga\" target=\"_blank\" style=\"color: rgb(39, 170, 225);\">Purbalingga</a>, kami telah mengecek ke rumahnya, tapi kosong.\"</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"Kami akan telusuri kepada yang bersangkutan.\"</p><p class=\"ql-align-justify\">\"Mudah-mudahan ini nanti dapat diketahui asal dari mana.\"</p><p class=\"ql-align-justify\">\"Kontak dengan siapa saja, sehingga bisa mengkarantina sebelum menyebar,\" jelas Husein.</p>', '2023-11-17');

